import logo from './logo.svg';
import './App.css';
import YardageCalc from './YardageCalc.js';
import GuageCalc from './GuageCalc.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <h1>Helpful Knitting and Crochet Calculators</h1>
      <YardageCalc/>
      <GuageCalc/>
      </header>
    </div>
  );
}

export default App;
